import React, { useEffect, useState } from 'react';
import Axios from "axios";

const App = () => {
  const [data,setData] = useState("");

  const getData = async() =>{
    const response = await Axios.get("http://localhost:5000/getdata");
    setData(response.data)
  }

  useEffect(() =>{
    getData();
  },[]);

  return (
    <h1>Data:{data}</h1>
  );
}

export default App;
